INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (408, 20749, 980, '2016-10-19 00:00:00', '11:25', 'Voce me procurou??????\r\nPrimeiro a mandar mensagem aqui fui eu!!!\r\nVoce em NENHUM MOMENTO mandou seus horarios!\r\nVoce acha qur você falar \"ESTOU ONLINE,VAMOS\" voce ta marcando jogo comigo? NÃO, jogo tem que ser marcado com antecedência, Nunca iria saber seus horários disponíveis dai da alemanha...\r\nVocê em NENHUM MOMENTO DEIXOU ISSO AQUI JUNTAMENTE COM SUA GRADE ENTÃO NÃO ACHE QUE VOCÊ TEM RAZÃO PELO FATO DE TER RESPONDIDO \"estou obline agora\" 2 vezes que você marcou não. \r\nESTÁS MUITO ENGANADO!!!!\r\nObs moderação: No sabado chegamos a tentar jogar, tentamos umas 6 vezes mas tava dando erro de conexão, e quando conectou caiu na arena de treino antes do jogo,então tive que sair.....\r\n\r\n\r\nModeração, eu solicito adiamento por incompatibilidade de horários em dias de semana, o rapaz mora na alemanha, e eu nem imagino quais sao os horários disponiveis dele pois em momento algum ele disse aqui, infelizmente não sou magico pra advinhar os horários dele.\r\n\r\nDesde já agradeço e aguardo retorno.', 'MuriloGarrido');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (409, 20749, 980, '2016-10-19 00:00:00', '11:37', 'VI QUE VOCÊ ESTÁ ONLINE, VOU PARAR O TRABALHO E VOU ENTRAR NO VIDEO GAME!\r\nVamos jogar!!!', 'MuriloGarrido');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (410, 20749, 967, '2016-10-19 00:00:00', '11:37', 'Eu te procurei sim! Quando via voce online te mandava mensagem no chat da PSN e voce nem respondeu. \r\n\r\nEu não tenho horário fixo pra jogar. Geralmente estou sempre online a questão é que estou 4 horas na frente devido o fuso horário da Alemanha.', 'Fantinatti');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (411, 20749, 980, '2016-10-19 00:00:00', '11:42', 'Ok, vamos jogar agora e resolver!\r\nE\r\nPrimeiro, voce me procutou 2 vezes, uma tentamos jogar e não deu e a outra eu nao estava em casa e meu olay tava ligando baixando jogo\r\nSegundo, você não é novo no site mas eu vou lhe lembrar para os seus próximos jogos, agendamento é pelo SITE e não pela PSN.', 'MuriloGarrido');
