INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (573, 20938, 528, '2016-10-20 00:00:00', '19:38', 'Caro Gustavo,\r\n\r\nPrimeiramente gostaria de lhe pedir desculpas pelo ocorrido nesta partida. Já aconteceu algumas vezes isso comigo e as vezes esqueço de algumas regras. Por mais que é uma brincadeira e não vale nada, nosso espirito competitivo é muito forte e sei que ninguém quer perder.\r\nComo já nos enfrentamos na temporada passada sei que é um excelente técnico e não tenho dúvida que chegara entre 8 primeiro colocados para segunda fase.\r\nEntendo perfeitamente atitude dos moderadores pois estão aqui para as coisas não escambarem e as pessoas não perderem a fé no site e as regras serem cumpridas.\r\nComo viajo e calha as vezes de não conseguir jogar,a partir de agora sempre que colocar um pedido de adiamento solicitarem ao meu adversário para entrar e da um ok pelo menos.', 'alexnf');
