INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (1417, 20956, 411, '2016-10-29 00:00:00', '12:03', 'Em respeito e consideração que tenho ao Site e seus moderadores, Não irei responder o post acima da maneira que deveria.\r\nJá estou no Arena Fifa a algum tempo e todos aqui me conhecem bem.. não vai ser esse aí que irá mudar minha conduta. Em momento algum faltei com respeito ao mesmo.pois qdo o mesmo fez 1x0 ficou c brincadeira no áudio,  normal..  Mas qdo virei o jogo ficou todo xateadinho. Não entrei no Arena pra ficar me aborrecendo com esses mlks. Sei que a moderação irá fazer algo..  Sem mais ', 'NEGO__MALA');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (1418, 20956, 419, '2016-10-29 00:00:00', '12:12', 'Conheco o Nego_mala a mais de 3 anos quase, é um cara respeitador e grande jogador, com esta resposta mostra o quanto é respeitoso e lindo por dentro...\r\n\r\nAcredito que a moderação Arena não ficara omissa, afinal conheço a muito tempo e disputo aqui varios champs, confio neles....\r\n\r\nNego mala bela atitude nego lindo!!!!\r\n\r\nLulucacho _|_', 'taepa1781');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (1419, 20956, 1021, '2016-10-29 00:00:00', '12:30', 'Conhece o Nego mala ,e é amiguinho dele,conheço muitas pessoas que sairam daqui por causa de palhaços igual esse que nao sabem perder eu jogo pra brincar ,sou pai de familia e tenho 35 anos,ve se vou me estressar por causa de jogo de video game,agora Moderador fique com seu grupinho ai e vai um recado pra outros moderadores,se vcs querem sites com amiguinhos,vcs nunca vao sair desse mundinho e ter jogadores de nivel aqui,pois todos que saim daqui reclama disso,de babacas igual Nego mala entre outros,enquanto vcs ficarem dando moral e nao cortando essa turma o Arena vai ser limitado entre os mesmos idiotas.Tem muita gente boa aqui,mais vcs nao deixam o nivel aqui elevar por causa de amizades e alguns babacas.Obrigado e espero que reflitam depois desse episosio.abs aos amigos que fiz aqui e peço minha retirada do site', 'Lulucacho1526');
