INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4352, 21484, 984, '2016-11-23 00:00:00', '17:20', 'Magralha, podemos tentar no sábado pela manhã,  umas 8h. Terei compromisso a partir de 9h e domingo não terei como. Na semana que vem terei segunda e quarta (serviço 24h na 3a e na 5a me impedem de jogar, assim como de sexta à noite a domingo estarei em passeio). Talvez há possibilidade nesta 5a a noite (pouco provável) ou sábado até no máximo 8h30. Abç', 'sergiothiago');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4353, 21485, 984, '2016-11-23 00:00:00', '17:28', 'Podemos adiantar a partida e tentar jogar amanhã entre 12h e 16h ou na sexta entre 12h e 17h ou no sábado às 8h, com aval da moderação. No domingo não terei como. Na semana que vem quando abre a rodada do nosso jogo terei segunda e quarta (serviço 24h na 3a e na 5a me impedem de jogar, assim como de sexta à noite a domingo estarei em passeio). Sugiro antecipar este jogo pra esta semana pelo fato de semana que vem ser muito corrida para mim. Aguardo retorno. Abç\r\n\r\n', 'sergiothiago');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4354, 21485, 984, '2016-11-23 00:00:00', '17:36', 'Moderador, venho solicitar a antecipação da partida Club León x U. Chile, rodada 6, grupo 7 da Libertadores para podermos jogar nesta semana pelo fato de estar muito atarefado com trabalho e outros afazeres de ordem particular durante a semana que vem, na qual abre a rodada supra citada. Peço a compreensão e aguardo a resposta no tópico para que meu adversário esteja ciente.\r\n\r\n\r\n', 'sergiothiago');
