INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5133, 21022, 949, '2016-11-30 00:00:00', '00:28', 'desculpa junior mas não concordo com o veredito, explico os motivos e peço revisão da decisão....\r\nCom muita antecendência eu postei meus horários e Adriano só postou sua disponibilidade na véspera, o que é considerado omissão parcial pela regra, inclusive já fui penalizado em decisão igual.\r\n Independente disso ainda fiquei online e fiz jogos pelo superfifa e arena, e me extendi até 1:40hs, inclusive quando joguei com George já eram mais de meia-noite.', 'mantavix');
