INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5351, 21022, 422, '2016-12-01 00:00:00', '10:30', 'Pessoal bom dia..... a moderação analisou com total critério, e a decisão e será decretado 2x0 por omissão parcial a Fiorentina, pois a rodada abriu dia 24 e o primeiro post foi dia 27, sendo assim vamos arrumar o resultado.\r\n\r\n(obs: Não será adicionado pontos negativos a Fiorentina)\r\n\r\nAbraço e bom jogos ', 'juniorverde');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (5352, 21022, 390, '2016-12-01 00:00:00', '10:42', 'Só uma dica pro adversário. .irmão presta bem atenção quando posta que pode até 23:30 não jogue até 01..02..003.hr da manhã pra vc no outro dia posta que ficou esperando outra quando o adversário lhe fazer uma pergunta rresponda o jogo é mas justo. ..entendeu ..Não se faça de desentendido. .\r\n\r\nAproveite esse ppontos espero que consiga algo. .\r\n\r\nModeração só fica atentando com a marcação o mesmo informa que pode jogar até 23:30 e não até 01hr de resto tranquilo. .\r\n\r\nQuando vc for assim não coloca horário final ddeixa em aberto', 'Bezerra2011');
