INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8766, 21868, 944, '2017-01-30 00:00:00', '10:30', 'Murilo, Bom dia!\r\n\r\n\r\ndia 28/01/2017 às 13:13 eu informei que se você me visse ON era só chamar.\r\nVocê disse que estaria disponível até as 18:30.\r\nEm momento nenhum você mandou mensagem por aqui ou pela PSN. Como poderíamos jogar assim?', 'G_Augustto');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8767, 21871, 1119, '2017-01-30 00:00:00', '15:04', 'Vou tentar ligar hoje as 19:00', 'rogeriolsimo');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8768, 21868, 980, '2017-01-30 00:00:00', '15:10', 'Amigo, \"SE EU VER VOCÊ ON\" não é marcar nada, falei que poderia jogar sabado a tarde toda e domingo o dia todo ate as 18:30....\r\nQueres horario mais flexível que isso???? Impossível... podia jogar no final de semana.\r\nAgora eu dizer que posso até as 18:30 NÃO QUER DIZER que estarei on O DIA TODO te esperando até as 18:30. Você entrou, NÃO AVISOU AQUI que entrou e avisou ao sair kkkk,\"esperei até agora\" kkk eu iria adivinhar que voce estava on??\r\nMe poupe.\r\nLembrando que voce disse que poderia sabado de manhã e eu PERGUNTEI que horas pois eu acordaria pra jogar e você simplesmente IGNOROU minha pergunta e ja disse que domingo nao dava...\r\nComplicado essa galera que adora WO.....\r\nComplica as coisas pelo wo ai é dificil\r\n\r\nSe tava com medo de perder era SÓ AVISAR que eu deixava você ganhar..\r\nFugir assim um final de semana inteiro (sabado e domingo) que é f....', 'MuriloGarrido');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8769, 21868, 944, '2017-01-30 00:00:00', '16:15', 'Murillo, Boa Tarde!\r\n\r\n\r\n\r\nPor duas vezes marquei de jogar com você ás 18hrs. Você disse que não podia. Beleza. Sem problemas...\r\nMas estou procurando aqui em nossas conversas... Em nenhuma conversa sua tem você especificando um horário para jogarmos. Os horários propostos por você eram sempre incertos... Tipo, posso mais tarde a noite... Posso o dia todo até 18:30....\r\n\r\nVocê em nenhum momento especificou um horário para jogarmos a partida. Simples. Foi isso que aconteceu.\r\n\r\n\r\nTá escrito no tópico da partida:\r\n\r\n- Os jogadores devem agendar, preferencialmente, com antecedência, um dia e uma hora exata para a realização da partida.\r\n\r\n\r\nEntão... Não vem com essa de W.O.. Jogo o Arena a mais de 4 temporadas. Só Nunca tive problemas com W.O. . E quando aconteceu foi eu que tomei o W.O. pq acabei me passando nas datas e não comentei no site o horário que poderia jogar. Os W.O. que tive a favor, todos foram porque os jogadores abandonaram o campeonato. \r\nDesde o dia 25-01 que estou tentando jogar a partida.', 'G_Augustto');
INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8770, 21871, 1119, '2017-01-30 00:00:00', '16:53', 'Hoje não vou chegar antes das 01 da manhã mas amanhã se tudo der certo estou de folga ao jogamos', 'rogeriolsimo');
