INSERT INTO `TB_COMENTARIO_JOGO_14` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8772, 21868, 980, '2017-01-30 00:00:00', '19:08', 'Hahahahahahah voce SÓ PODE JOGAR AS 18 e eu podia no SABADO E DOMINGO O DIA TODO COMO DISSE, DE 10 da manha ate 18:30 estaria em casa livre, SIMPLES INTERPRETAÇÃO..e voce nao podia... me poupe amigo, MUITO CHORO!!!\r\nExatamente, AVISEI COM ANTECEDÊNCIA QUE PODERIA NO SABADO E NO DOMINGO E VOCE ME CHAMOU NA SEXTA DE MANHA PARA JOGAR AS 18 e na mesma hora respondi que nao poderia jogar...\r\nATE AGORA O UNICO ERRADO É VOCÊ.. e no domingo SIMPLESMENTE aparece dizendo que estava on hahahahhaha SEM TER MARCADO ou seja eu teria que ter adivinhado que voce iria entrar kkkkk sendo que eu estava em casa.. bastava ter mandado uma mensagem aqui que eu olharia meu email mas naaao,\r\nAgiu de má-fé e avisou quando ja tinha saido kkkkkk\r\nJogo arena a mais tempo..\r\nE DESDE K DIA 25/01 EU LHE RESPONDI NA MESMA HORA...\r\nEnfim isso nao vai dar em nada, o que a moderacao decidir pra mim ta bom..', 'MuriloGarrido');
